import Link from "next/link"

const Navbar = () => {
    const styles = {
        display: "flex",
        background: "green",
        justifyContent: "space-between",
        padding: "1rem"
    }
    return (
        <div style={styles}>
            <Link href="/about"><a>About Page</a></Link>
            <Link href="/contact"><a>Contact Page</a></Link>
        </div>
    );
};

export default Navbar;
